import React from 'react'
import Head from 'next/head'
// import { FixedMenu } from '../components/Navigation/FixedMenu'

export const MainLayout = ({ children, title }) => {

  return (
    <>
      <Head>
        <title>{ title }</title>
        <meta charSet="utf-8"/>
        <meta name="viewport" content="initial-scale=1.0, width=device-width"/>
      </Head>

      <header>
        {/*<FixedMenu/>*/ }

        <nav>
          NAVIGATION
        </nav>
      </header>

      <main>
        { children }
      </main>

      <footer>FOOTER</footer>

      <style jsx>{ `
        @font-face {
          font-family: 'Circe';
            src: url('/fonts/Circe-Regular.eot');
            src: url('/fonts/lazer.woff2') format('woff2'),
                 url('/fonts/lazer.eot?#iefix') format('embedded-opentype'),
                 url('/fonts/lazer.woff') format('woff'),
                 url('/fonts/lazer.ttf') format('truetype'),
                 url('/fonts/lazer.svg#lazer') format('svg');
          font-weight: normal;
          font-style: normal;
        }
      `}</style>
    </>
  )
}
